import React from 'react';
import './Destination.css';
import DestinationItem from './DestinationItem';

function DestinationContent() {
  return (
    <div className='visit'>
      <h1>Check out these EPIC Destinations!</h1>
      <div className='visit__container'>
        <div className='visit__wrapper'>
          <ul className='visit__items'>
            <DestinationItem 
              src='images/bromo.jpg'
              text='Indonesia is ranked as the worlds No. 6 most beautiful country compiled by the London-based travel guide website Rough Guides, making it the best among Asian countries. According to the results of voting submitted by Rough
              Guides readers, Indonesia was famous for myriad of islands and volcanoes that span across its vast territory. The nation was also rich in cultural heritages from ethnic groups inhabiting thousands of islands in the country. In
              the voting process, Indonesia left behind two other Asian countries voted by readers, India and Vietnam, at ranks of 13 and 20 respectively.'
              path=''
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default DestinationContent;
